        /// <summary>
        /// 拼音描述类集合
        /// </summary>
        private static Collection<PYInfo> m_Chinese;

        /// <summary>
        /// 获得中文的拼音（全拼）
        /// </summary>
        /// <param name="s">中文</param>
        /// <returns>中文的拼音（全拼）</returns>
        public static string GetPY(string s)
        {
            if (s == null || s.Trim().Length == 0)
            {
                return string.Empty;
            }

            s = s.Trim();
            if (m_Chinese == null)
            {
                FillChinese();
            }

            string ret = string.Empty;
            foreach (char c in s)
            {
                if ((c >= 'A' && c <= 'z') || char.IsDigit(c))
                {
                    ret += c;
                }
                else
                {
                    int intPyCode = GetPYCode(c);
                    PYInfo py = FindItem(0, m_Chinese.Count - 1, intPyCode);
                    ret += py == null ? FindExtPY(c) : py.PY;
                }
            }

            return ret;
        }
        /// <summary>
        /// 获得中文的拼音（首字母）
        /// </summary>
        /// <param name="s">中文</param>
        /// <returns>中文的拼音（全拼）</returns>
        public static string GetSZM(string s)
        {
            if (s == null || s.Trim().Length == 0)
            {
                return string.Empty;
            }

            s = s.Trim();
            if (m_Chinese == null)
            {
                FillChinese();
            }

            string ret = string.Empty;
            foreach (char c in s)
            {
                if ((c >= 'A' && c <= 'z') || char.IsDigit(c))
                {
                    ret += c;
                }
                else
                {
                    int intPyCode = GetPYCode(c);
                    PYInfo py = FindItem(0, m_Chinese.Count - 1, intPyCode);
                    ret += py == null ? FindExtPY(c).Substring(0, 1) : py.PY.Substring(0, 1);
                }
            }

            return ret;
        }

        /// <summary>
        /// FindExtPY
        /// </summary>
        /// <param name="c">c</param>
        /// <returns>未知</returns>
        public static string FindExtPY(char c)
        {
            int start = m_ExtPY.IndexOf(c);
            if (start == -1)
            {
                return c.ToString();
            }

            int leftStart = m_ExtPY.LastIndexOf('[', start);
            if (leftStart == -1)
            {
                return c.ToString();
            }

            int rightStart = m_ExtPY.IndexOf(']', leftStart);
            if (rightStart == -1 || ((rightStart - leftStart) <= 1))
            {
                return c.ToString();
            }

            return m_ExtPY.Substring(leftStart + 1, rightStart - leftStart - 1);
        }

        /// <summary>
        /// FindItem
        /// </summary>
        /// <param name="begin">begin</param>
        /// <param name="end">end</param>
        /// <param name="p_pyCode">p_pyCode</param>
        /// <returns>未知</returns>
        private static PYInfo FindItem(int begin, int end, int p_pyCode)
        {
            if ((end - begin) <= 1)
            {
                PYInfo p = m_Chinese[begin];
                if (p.Code == p_pyCode)
                {
                    return p;
                }
                else if ((end - begin) == 1)
                {
                    p = m_Chinese[end];
                    if (p.Code == p_pyCode)
                    {
                        return p;
                    }
                }

                return null;
            }

            int middle = begin + (int)((end - begin) / 2);
            PYInfo mpy = m_Chinese[middle];
            if (mpy.Code == p_pyCode)
            {
                return mpy;
            }
            else if (mpy.Code < p_pyCode)
            {
                return FindItem(middle, end, p_pyCode);
            }
            else
            {
                // myp.Code > pyCode
                return FindItem(begin, middle, p_pyCode);
            }
        }

        /// <summary>
        /// 加载常用拼音字库
        /// </summary>
        private static void FillChinese()
        {
            m_Chinese = new Collection<PYInfo>();

            string[] temp = m_AllPY.Split(' ');
            int count = temp.Length;
            int index = 0;
            while (index < count)
            {
                string s = temp[index];

                // 汉字
                if (s.Length == 1 && !(s[0] >= 'A' && s[0] <= 'z'))
                {
                    PYInfo py = new PYInfo();
                    py.Chinese = s;
                    py.Code = GetPYCode(s[0]);
                    py.PY = temp[++index];

                    AddChinese(py);
                }

                index++;
            }
        }

        /// <summary>
        /// 获取字节码
        /// </summary>
        /// <param name="s">字符</param>
        /// <returns>字节码</returns>
        private static int GetPYCode(char s)
        {
            // 根据系统默认编码得到字节码 
            byte[] array = System.Text.Encoding.Default.GetBytes(s.ToString());

            // 非汉字
            if (array.Length < 2)
            {
                return -99999999;
            }
            else
            {
                // 取字节1 
                int i1 = (short)array[0];

                // 取字节2
                int i2 = (short)array[1];
                return (i1 * 256) + i2;
            }
        }

        /// <summary>
        /// 加载常用拼音字库
        /// </summary>
        /// <param name="py">拼音描述</param>
        private static void AddChinese(PYInfo py)
        {
            int count = m_Chinese.Count;

            if (count == 0 || py.Code > m_Chinese[count - 1].Code)
            {
                m_Chinese.Add(py);
                return;
            }

            int i = 0;
            foreach (PYInfo p in m_Chinese)
            {
                if (py.Code == p.Code)
                {
                    throw new Exception(string.Format("以下汉字的编码重复:\r\n编码:{0}\t汉字:{1}\t拼音:{2}\r\n编码:{3}\t汉字:{4}\t拼音:{5}", p.Code, p.Chinese, p.PY, py.Code, py.Chinese, py.PY));
                }

                if (py.Code < p.Code)
                {
                    m_Chinese.Insert(i, py);
                    return;
                }

                i++;
            }

            // 应该永远不会执行
            m_Chinese.Add(py);
        }
    }

    /// <summary>
    /// 拼音描述Model
    /// </summary>
    internal class PYInfo
    {
        /// <summary>
        /// 汉字编码
        /// </summary>
        private int m_code;

        /// <summary>
        /// 汉字
        /// </summary>
        private string m_chinese;

        /// <summary>
        /// 拼音
        /// </summary>
        private string m_py;

        /// <summary>
        /// 构造拼音描述Model
        /// </summary>
        public PYInfo()
        { 
        }

        /// <summary>
        /// 根据参数构造拼音描述Model
        /// </summary>
        /// <param name="code">汉字编码</param>
        /// <param name="chinese">汉字</param>
        /// <param name="py">拼音</param>
        public PYInfo(int code, string chinese, string py)
        {
            this.m_code = code;
            this.m_chinese = chinese;
            this.m_py = py;
        }

        /// <summary>
        /// 获取或设置汉字编码
        /// </summary>
        public int Code
        {
            get { return this.m_code; }
            set { this.m_code = value; }
        }

        /// <summary>
        /// 获取或设置汉字
        /// </summary>
        public string Chinese
        {
            get { return this.m_chinese; }
            set { this.m_chinese = value; }
        }

        /// <summary>
        /// 获取或设置拼音
        /// </summary>
        public string PY
        {
            get { return this.m_py; }
            set { this.m_py = value; }
        }
    }
}
